弊社は楽天市場店の他に店頭や雑誌広告でも通信販売を行っており、<br>
タイミングによっては商品が欠品になっている可能性もあります。<br>
購入手続きが完了してもすでに完売となっている場合、納期が掛かる事をご了承ください。<br>
実際の在庫状況等については受注確認メールでご案内いたします。約10ミリの穴さえあれば取り付け可能な<br>
LED球の各色2個セット品です。<br>
ブルー、ホワイト、オレンジ、<br>
レッドからお選びください。<br>
スモール、デイライト、タイヤ灯、バックフォグ、<br>
ハイマウントストップ、ウインカー・・・<br>
使い方はアイデア次第です。<br>
大きさは、直径22ミリ、発光面13ミリ<br>
取り付け外高さ11ミリ、取り付けネジ径9ミリ、<br>
ネジ部長さ21ミリです。<br>
あくまでDIY用汎用部品ですので、<br>
取説、配線キット等はありません。<br>
1.5W球です。<br>
